import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, Button} from "react-bootstrap";
import axios from "axios";

function App() {
  const [username, setUsername] = React.useState<string>("");
  const [password, setPassword] = React.useState<string>("");

  const headUrl: string = 'http://localhost:8080';

  function submitLoginInfo (){
    const addUserUrl = `${headUrl}/account/add`

    axios.post('http://localhost:8080/account/add', {
      username: 'kyle',
      password: 'trom'
    })
        .then(function (response) {
          console.log(response);
        })
      // Axios.post(addUserUrl, {username: username, password: password})
      //     .then(function (response) {
      //       console.log(response);
      //     }).catch (e => {
      // console.log(`ERROR received from ${addUserUrl}: ${e}\n`);
      //     console.log(e.response);
      //     console.log(e.request);
      //     console.log(e.message);});
  };



  return (
    <div className="App">
      <header className="App-header">
        <Form>
          <Form.Group controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="Enter username" onChange={(e) => {setUsername(e.target.value)}} />
            <Form.Text className="text-muted">
              We'll never share your email with anyone else.
            </Form.Text>
          </Form.Group>

          <Form.Group controlId="formBasicPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" onChange={(e) => {setPassword(e.target.value)}}/>
          </Form.Group>
          <Form.Group controlId="formBasicCheckbox">
            <Form.Check type="checkbox" label="Check me out" />
          </Form.Group>
          <Button variant="primary" onClick={submitLoginInfo}>
            Submit
          </Button>
        </Form>
      </header>
    </div>
  );
}

export default App;
